import Rebase from 're-base';
import firebase from 'firebase';

const firebaseApp = firebase.initializeApp({
    apiKey: "AIzaSyBeSZieOjCbID6Ce9NPFOiz1-2axUENkSg",
    authDomain: "catchsetpc.firebaseapp.com",
    databaseURL: "https://catchsetpc.firebaseio.com",
    projectId: "catchsetpc",
    storageBucket: "catchsetpc.appspot.com",
    messagingSenderId: "627840953958"
});

const base = Rebase.createClass(firebaseApp.database());

// this is a named export 
export {firebaseApp};

// this is a default export 
export default base;
